import React, { useEffect, useState } from "react";

interface Paciente {
  id: number;
  nome: string;
  idade: number;
  condicao: string;
}

const PatientList: React.FC = () => {
  const [patients, setPatients] = useState([]);



  return (
    <div>
      <h2>Lista de Pacientes</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Idade</th>
            <th>Condição Médica</th>
          </tr>
        </thead>
        <tbody>
          {patients.map((patient) => (
            <tr key={patient.id}>
              <td>{patient.id}</td>
              <td>{patient.nome}</td>
              <td>{patient.idade}</td>
              <td>{patient.condicao}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PatientList;
